import React, { useEffect } from "react";

const Home=()=>{
    
    useEffect(()=>{
        const fetchTodo = async()=>{
            const response = await fetch('http://localhost:4000/api/workouts')
            const json = await response.json()
        }
        fetchTodo();
    },[])

    
    return(
        <div>
            <h1>Home</h1>
        </div>
    )
}
export default Home;
